import { Injectable } from '@angular/core';
import { CarnetBilanMensuel } from '../models/CarnetBilanMensuel';
import { HttpClient, HttpHeaders, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class CarnetBilanMensuelService {
  private apiUrl = 'https://localhost:7129/api/CarnetBilanMensuels';

  constructor(private http: HttpClient) { }
  addcarnet(CarnetBilanMensuel: CarnetBilanMensuel): Observable<any> {
    console.log('Creating it with data:', CarnetBilanMensuel);

    return this.http.post(`${this.apiUrl}/addcarnet`, CarnetBilanMensuel, { observe: 'response', responseType: 'text' });
  }
  getById(patientId: number): Observable<any> {
    return this.http.get<any>(`${this.apiUrl}/${patientId}`);
  }

update(patientID: number, complication: CarnetBilanMensuel): Observable<any> {
  const url = `https://localhost:7129/api/CarnetBilanMensuels/update/${patientID}`;
  return this.http.put(url, complication, {
    headers: new HttpHeaders({
      'Content-Type': 'application/json'
    })
  });
}
}
